import Video from './demo_vids/drowsiness.mp4';
import Poster from './demo_vids/drowsiness.png';
import Img from './images/drowsiness.png';
export const drowsiness = {
    lightBg: false,
    lightText: true,
    lightTextDesc: true,
    headline: 'Drowsiness Detection',
    description:
      'This particular feature, we are again targeting already admitted patients. If a patient suddenly starts to choke, the nurses/doctors would be alerted immediately so he/she may be attended to.',
    imgStart: '',
    img: Img,
    alt: 'Credit Card',
    path: Video,
    poster: Poster
  };
